    func uploadPandaVideo(videoData: Data, videoSize: Bool, urlVideo: URL, completionHandler: @escaping (String) -> Void) {
//        getHosts()
        firstStep(fileName: "nomeDoArquivo", completionHandler: { (fileId) in
            print(fileId)
            print(videoData)
