    func firstStep(fileName: String, completionHandler: @escaping (String) -> Void) {
        
        var fileId = ""
        
        let headers = [
            "accept": "text/plain",
            "Tus-Resumable": "1.0.0",
            "Upload-Length": "414807",
            "content-type": "application/json",
            "Upload-Metadata": "authorization cGFuZGEtMzVhNDA3OGZmMDUwZTdjNzFjNGVjNmE3NWNjOTBiNjdiZTdmNjA1ZDRjMjM2MmE0ZDQ1NTk1NDU0OTRlMTkwMw==, filename \(fileName)"
        ]

        let request = NSMutableURLRequest(url: NSURL(string: "https://uploader-us01.pandavideo.com.br/files")! as URL,
                                                cachePolicy: .useProtocolCachePolicy,
                                            timeoutInterval: 10.0)
        request.httpMethod = "POST"
        request.allHTTPHeaderFields = headers

        let session = URLSession.shared
        let dataTask = session.dataTask(with: request as URLRequest, completionHandler: { (data, response, error) -> Void in
          if (error != nil) {
            print(error as Any)
          } else {
            let httpResponse = response as? HTTPURLResponse
              
              if let link = httpResponse?.allHeaderFields["Location"] as? String {
                  let linkSplited = link.split(separator: "/")
                  fileId = String(linkSplited[linkSplited.count-1])
              } else {
                  //mostrar um alerta de que deu erro
              }
              completionHandler(fileId)
          }
        })

        dataTask.resume()
    }
    
    
